controller.A.onEvent(ControllerButtonEvent.Pressed, function () {
    controller.moveSprite(CursorPoint, 0, 0)
    PathChecker.setPosition(StartingPoint.x, StartingPoint.y)
    for (let index = 0; index <= spriteutils.distanceBetween(LastDrawnPoint, CursorPoint); index++) {
        spriteutils.placeAngleFrom(
        PathChecker,
        spriteutils.angleFrom(LastDrawnPoint, CursorPoint),
        0 - index,
        CursorPoint
        )
        if (scene.backgroundImage().getPixel(PathChecker.x, PathChecker.y) == 1 || (scene.backgroundImage().getPixel(PathChecker.x, PathChecker.y) == 3 || (scene.backgroundImage().getPixel(PathChecker.x, PathChecker.y) == 6 || (scene.backgroundImage().getPixel(PathChecker.x, PathChecker.y) == 7 || (scene.backgroundImage().getPixel(PathChecker.x, PathChecker.y) == 14 || scene.backgroundImage().getPixel(PathChecker.x, PathChecker.y) == 13))))) {
            ClearPath = false
        }
    }
    if (ClearPath) {
        if (LastDrawnPoint.x == CursorPoint.x && LastDrawnPoint.y == CursorPoint.y) {
            EndingPoint = sprites.create(img`
                f f f 
                f 8 f 
                f f f 
                `, SpriteKind.Marker)
            EndingPoint.setPosition(CursorPoint.x, CursorPoint.y)
            if (EndingPoint.overlapsWith(Destination)) {
                Money += Math.round(160 - DistanceTraveled)
                blockSettings.writeNumber("Money", Money)
                if (Math.round(MaxDistances[CurrentLevel] - DistanceTraveled) > 0) {
                    game.showLongText("Customer: \\n Thanks! Based on the length of the route you gave me, I'll pay $" + convertToText(Math.round(MaxDistances[CurrentLevel] - DistanceTraveled)) + ".", DialogLayout.Full)
                } else {
                    game.showLongText("Customer: \\n This is way to long! I am NOT satisfied! Infact, I'm going to take money from you! You just lost " + convertToText(Math.round(MaxDistances[CurrentLevel] - DistanceTraveled) - Money) + " dollars!", DialogLayout.Full)
                }
                MoneyDisplay.setText("$" + convertToText(Money))
            } else {
                game.showLongText("Customer: \\n What!? This route doesn't even reach my destination! I want a refund.", DialogLayout.Full)
            }
            DistanceTraveled = 0
            game.reset()
        } else {
            DistanceTraveled += spriteutils.distanceBetween(LastDrawnPoint, CursorPoint)
            DistanceDisplay.setText("" + convertToText(Math.round(DistanceTraveled)) + " Miles Long")
            DistanceDisplay.right = 161
            BridgePoint = sprites.create(img`
                5 5 5 
                5 8 5 
                5 5 5 
                `, SpriteKind.Marker)
            BridgePoint.setPosition(CursorPoint.x, CursorPoint.y)
            PreviousLines.image.drawLine(LastDrawnPoint.x, LastDrawnPoint.y, CursorPoint.x, CursorPoint.y, 8)
            LastDrawnPoint = BridgePoint
            controller.moveSprite(CursorPoint, 50, 50)
        }
    } else {
        game.splash("The route cannot overlap", "with land or dangerous areas.")
        controller.moveSprite(CursorPoint, 50, 50)
    }
    ClearPath = true
    for (let value of sprites.allOfKind(SpriteKind.Text)) {
        value.z = 100
    }
})
